export const Nav = (props) => {
    return (
        <div className='nav-container'>
            <div className='nav'>
                <img className='logo' src='https://i.imgur.com/IiKnuHJ.png'></img>
                <ReactSearchBox
                />
            </div>
        </div>
    )
}


export default Nav
